To output the values in a JavaScript object (dictionary) sorted by key alphabetically, you can first convert the keys into an array and then sort it. Here's how you can do it:

```javascript
const obj = {
  c: 'valueC',
  b: 'valueB',
  a: 'valueA'
};

// Get the keys of the object and convert them into an array
const keys = Object.keys(obj);

// Sort the array of keys in alphabetical order
keys.sort();

// Loop through the sorted keys and output the corresponding values
for (let key of keys) {
  console.log(`${key}: ${obj[key]}`);
}
```

When you run this code, it will output:

```
a: valueA
b: valueB
c: valueC
```

This is because the keys have been sorted alphabetically before they were output.
